import React from 'react';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom'
import Registro from './routes/Registro';

const App = () =>{
    return (
    <div>
        <Router>
            <Switch>
            <Route exact path="/" component={Registro}/>
            <Route exact path="/login" >hola</Route>

            </Switch>
        </Router>
    </div>
    )
}

export default App;
